import React from 'react';
import styled from 'styled-components';
import RegisterForm from '../components/RegisterForm'

const Register = ({}) => {
    return (
        <Wrapper>
            <H1>Bonjour <span>Etudiant</span> !</H1>
            <Text>Vous avez reçu par mail un mot de passe temporaire que vous devez obsolument modifier lors de votre 1ère connexion.</Text>
            <RegisterForm></RegisterForm>
            <P href='/login'>J'ai déjà un compte</P>
        </Wrapper>
    );
};

export default Register;

const Text=styled.p`
    color:red;
`
const Wrapper=styled.section`
    display:flex;
    width:100%;
    align-items:center;
    flex-direction:column;
    padding-top:100px;
    padding-bottom:100px;
`

const H1=styled.h1`
    font-size:3rem;
    color:#E54B4B;
    span{
        color:#358F8B;
    }
    padding-bottom:80px;
`

const P=styled.a`
    font-size:0.8rem;
`
